import styled from "styled-components";



export const Home_About_Wrapper = styled.section`
  width: 100%;
  height: 900px;
  max-width: 1280px;
  margin: auto;
  position: relative;
  overflow-x: hidden;
`



export const Home_About_Text_Wrapper_Top = styled.div`
  width: 243px;
  overflow: hidden;



`;


export const Home_About_Text_Wrapper_Center = styled.div`
  width: 100%;
  max-width: 460px;
  margin: 93px auto;
  overflow: hidden;
  padding: 2px;



`;

export const Home_About_Svg_Background = styled.div`
    position: absolute;
  top:10%;
  left: 60%;

`;

export const Home_About_Text_Wrapper_Bottom = styled.div`
  width: 100%;
  margin-top: 63px;
  padding: 3px;
  display: flex;
  justify-content: flex-end;
  overflow: hidden;




`
